import { Link } from 'react-router-dom'

const User = ({ user }) => {
    return (
        <div>
            {user.name} {user.blogs.length} <strong>blogs</strong>
        </div>
    )
}

const Users = ({ users }) => {
    return (
        <div>
            <h2>Users</h2>
            {users.map((user) => (
                <div key={user.id}>
                    <Link to={`/users/${user.id}`}>
                        <User key={user.id} user={user} />
                    </Link>
                </div>
            ))}
        </div>
    )
}

export default Users
